let img_h = image.length;
let img_w = image[0].length;

let width = 0;
let height = 0;



if (img_w > img_h) {
  width = img_h;
  height = img_h;
} else {
  width = img_w;
  height = img_w;
}


setDocDimensions(width*scale, height*scale);

let finalLines = [];

const t = new bt.Turtle();

function toRadians(angle) {
  return angle * (Math.PI / 180);
}

function lerp(a, b, alpha) {
  return a + alpha * (b- a)
}

let r = 0
let sine_offset = 0;

for (let a = 0; a < toRadians(360 * width / 2); a += 0.005) {
  r = a / toRadians(360) *0.95;
  let angle_offset = toRadians(180)
  let x_index = Math.round((Math.cos(a + angle_offset) * r) + width / 2);
  let y_index = Math.round((Math.sin(a + angle_offset) * r) + +width / 2);
  let pixel_value = 255 - image[y_index][width - x_index];
  r += pixel_value / 255 * amplitude_multiplier;
  sine_offset = lerp(sine_offset, Math.sin(a * pixel_value * frequency_multiplier) * r / 150, 0.85)
  r += sine_offset
  let x = Math.cos(a) * r;
  let y = Math.sin(a) * r;

  t.goTo([x, y])
}

// add turtle to final lines
bt.join(finalLines, t.lines());


// center piece
const cc = bt.bounds(finalLines).cc;
bt.translate(finalLines, [width / 2 * scale, height / 2 * scale], cc);

// draw it
drawLines(bt.scale(finalLines, scale));